import React from 'react';
class Country extends React.Component{
    constructor(props){
        super(props);
        this.individual=props.country
    }
    render(){
        return(

            <div className="card">
                <img src={this.individual.flag}></img>
                <h3>{this.individual.name}</h3>
                </div>
        )
    }
}
export default Country;
